import React from 'react';
import './Experience.css'; // Ensure you handle the images well in your CSS

const Services = () => {
  return (
    <section id="services" className="services">
      <h2>Experience</h2>
      <div className="services-container">
        <div className="service-item">
          <img src="path_to_datalyzer_logo.png" alt="Datalyzer Logo" className="company-logo" />
          <h3>Datalyzer</h3>
          <p>Software Engineer</p>
          <a href="#learn-more">Learn more</a>
        </div>
        <div className="service-item">
          <img src="../assests/" alt="BrightChamps Logo" className="company-logo" />
          <h3>BrightChamps</h3>
          <p>Coding Instructor</p>
          <a href="#learn-more">Learn more</a>
        </div>
      </div>
    </section>
  );
};

export default Services;
